import React from 'react';
import './DeleteButton.css';

const DeleteButton = (props) => {
  const handleDeleteClick = () => {
    props.onDelete();
  };

  return (
    <button className="delete-button" onClick={handleDeleteClick}>
      Delete
    </button>
  );
};

export default DeleteButton;
